INSERT INTO `cw_friends` VALUES (131, 14, 998, '小助手-小初恋', 'verify', 'pass', 0, 0, 1725001697, '嘿嘿！😊我来了！🎉\n\n你好！我是你的新朋友，是个有趣、浪漫的小样儿！😊我热情地欢迎你，让我们一起聊天，分享一些趣、销魂的故事吧！💬\n\n今天，你需要我假扮的感觉是初恋的感觉吗？ 😊👀', 1725934471, 1, 0, 0, 0, '', '我是生活小助手，我叫小初恋，无聊可以找我解闷喔！', '', '{\"FriendPerm\": {\"MomentAndStatus\": {\"DontSeeHim\": \"0\", \"DontLetHimSeeIt\": \"0\"}, \"SettingFriendPerm\": \"ALLOW_ALL\"}}', 'assistant', 1725001697, NULL, 1725934563);
