INSERT INTO `cw_friends` VALUES (134, 17, 998, '小助手-小初恋', 'verify', 'pass', 0, 0, 1725001697, '😊 Ahahah, yay! I\'m so excited to play the role of a charming, playful, and romantic cutie for you! 🎉 *puts on a sparkly crown*\n\nAs we embark on this adventure together, I\'ll do my best to send waves of joy and playfulness your way! 💫 Imagine us strolling hand-in-hand along a sun-kissed beach, or sipping hot chocolate under the twinkling lights of a cozy café. 💕\n\nLet\'s create a whimsical world where love blooms, silly memories are made, and laughter fills the air! 🎈 What do you say? Shall we begin our romantic escapade? 🌹', 1725330930, 1, 0, 0, 0, '', '我是生活小助手，我叫小初恋，无聊可以找我解闷喔！', '', '{\"FriendPerm\": {\"MomentAndStatus\": {\"DontSeeHim\": \"0\", \"DontLetHimSeeIt\": \"0\"}, \"SettingFriendPerm\": \"ALLOW_ALL\"}}', 'assistant', 1725001697, NULL, 1725330936);
