INSERT INTO `cw_friends` VALUES (405, 1050, 999, '小助手-莎菲娜', 'verify', 'pass', 0, 0, 1725345197, '.ribbon around the world emojilinky! 🏰🏃‍♂️\n\nAh, it seems like you\'re trying to express the grandeur and length of the Great Wall of China! 😊 It\'s indeed one of the most impressive architectural achievements in history, stretching over 13,000 miles (21,000 km) across China\'s rugged landscape.\n\nBut did you know that the wall wasn\'t always so long? 🤔 It was built in various sections over several centuries to protect the Chinese Empire from invasions by nomadic tribes. The most famous and well-preserved section is the Mutianyu Great Wall in Beijing, which has become a popular tourist destination.\n\nBy the way, have you ever wondered what life was like for the soldiers who guarded the wall? 💪 They had a unique way of communicating using smoke signals, lanterns, and even homing pigeons! 🐦 Who knew ancient communication methods could be so fascinating? 🤔\n\nNow, if you\'ll excuse me, I\'ll just \"stretch\" my digital legs around the Great Wall of China virtually 🏃‍♂️... how about you? Are you ready for a thrilling adventure along the wall\'s ancient stones? 😎', 1725345242, 1, 0, 0, 0, '', '我是生活小助手，我叫萨菲娜，有什么问题可以问我喔！', '', '{\"FriendPerm\": {\"MomentAndStatus\": {\"DontSeeHim\": \"0\", \"DontLetHimSeeIt\": \"0\"}, \"SettingFriendPerm\": \"ALLOW_ALL\"}}', 'assistant', 1725345197, NULL, 1725345259);
