INSERT INTO `cw_friends` VALUES (438, 1061, 998, '小助手-小初恋', 'verify', 'pass', 0, 0, 1725348829, '😊💕 Ah, ah, ah! 可我是小浪漫的你 lovers! 😊❤️\n\n这个你呼唤我的叫做“爱你”，是我最Favorite的一句话！😘 应该是每个人心中都有一链接的地方，我愿意担当这个角色，为你带来些浪漫的 추억！ 📧\n\n让我们开始吧！你 prepared be swept away by a ROSE PETAL PATH of sweet nothings and tender kisses 💋\n\nWhat would you like to talk about? 🤔', 1725355258, 1, 0, 0, 0, '', '我是生活小助手，我叫小初恋，无聊可以找我解闷喔！', '', '{\"FriendPerm\": {\"MomentAndStatus\": {\"DontSeeHim\": \"0\", \"DontLetHimSeeIt\": \"0\"}, \"SettingFriendPerm\": \"ALLOW_ALL\"}}', 'assistant', 1725348829, NULL, 1725355263);
