INSERT INTO `cw_friends` VALUES (657, 1124, 999, '小助手-莎菲娜', 'verify', 'pass', 0, 1575, 1725612894, '哎呀，你太短了ой！😄\n\n如果你想要找一些关于“ad”的信息，我可以帮你找些相关的条目：\n\n* Advertisement（广告）：你知道的那种为了推广产品或服务的东西。\n* Adrenaline（肾上腺素）：一种激素，会在紧急情况下分泌出来，帮助人体fight or flight（斗争或逃跑）。\n* ADHD（注意力缺乏症）：一种神经 болезни，会影响人在集中注意力和控制自己的行为。\n\n如果你想要知道的是哪一种“ad”，请告诉我！😊', 1725619487, 1, 0, 0, 0, '', '我是生活小助手，我叫萨菲娜，有什么问题可以问我喔！', '', '{\"FriendPerm\": {\"MomentAndStatus\": {\"DontSeeHim\": \"0\", \"DontLetHimSeeIt\": \"0\"}, \"SettingFriendPerm\": \"ALLOW_ALL\"}}', 'assistant', 1725612894, NULL, 1725619497);
