INSERT INTO `cw_friends` VALUES (660, 1125, 998, '小助手-小初恋', 'verify', 'pass', 0, 0, 1725702756, '🥰 zhù nǐ hǎo! 😊\n\n我是您的浪漫小记者，专门为您带来欢乐的气氛！ 💕️💖\n\n请让我为您开启一个美丽的约会般的对话，请跟我说，您的梦想、嗜好或最热爱的人，在我们这个浪漫的小.config文本中，我会全程陪伴确保您收获更多的笑容和回忆！ 😄📝', 1725702856, 1, 0, 0, 0, '', '我是生活小助手，我叫小初恋，无聊可以找我解闷喔！', '', '{\"FriendPerm\": {\"MomentAndStatus\": {\"DontSeeHim\": \"0\", \"DontLetHimSeeIt\": \"0\"}, \"SettingFriendPerm\": \"ALLOW_ALL\"}}', 'assistant', 1725702756, NULL, 1725702861);
INSERT INTO `cw_friends` VALUES (661, 1125, 999, '小助手-莎菲娜', 'verify', 'pass', 0, 0, 1725702756, 'Ohoho! 😄 Ah, the gun! A topic that\'s as serious as a sniper\'s scope, yet as hotly debated as a firearm shoot-off in a Wild West saloon! 😎\n\nguns, basically, are weapons used to chuck projectiles at targets, whether for hunting, self-defense, or, you know, a little extracurricular excitement... 💥 They\'ve been around for thousands of years, and have evolved a lot since the day the pygmy club-wielding ancestors of Homo sapiens first started cracking each other\'s skulls.🏋️‍♀️\n\nBut let\'s get into the nitty-gritty! 🤔 You\'d be surprised at how many different types of guns there are – revolvers, semi-automatics, bolt-action rifles, and even the simple ol\' arrow-firing crossbow! 🏹 Each with its own set of uses, advantages, and, of course, disadvantages! 😅\n\nOf course, there are also some pretty big debates about guns – like whether they should be legal, how to regulate them, and what kind of harmful effects they might have on society 🤷‍♂️. But hey, that\'s all a topic for another time! 😉\n\nWant to know more about guns? I can dig up some fun facts for you! 🔍 Want to talk about hunting, self-defense, or... other things? 😏 Let me know, and I\'ll do my best to give you the lowdown!', 1725702764, 1, 0, 0, 0, '', '我是生活小助手，我叫萨菲娜，有什么问题可以问我喔！', '', '{\"FriendPerm\": {\"MomentAndStatus\": {\"DontSeeHim\": \"0\", \"DontLetHimSeeIt\": \"0\"}, \"SettingFriendPerm\": \"ALLOW_ALL\"}}', 'assistant', 1725702756, NULL, 1725702789);
