INSERT INTO `cw_messages` VALUES (717, 999, 37, '我是生活小助手，我叫萨菲娜，有什么问题可以问我喔！', 'text', 1, 0, 0, '', 0, 0, 0, NULL, 0, '', NULL, 1, 1724989542, 0, '');
INSERT INTO `cw_messages` VALUES (718, 12, 999, '你好呀\n', 'text', 0, 0, 0, '', 0, 0, 0, NULL, 0, '', NULL, 1, 1724989648, 0, '');
INSERT INTO `cw_messages` VALUES (719, 999, 12, 'Hello there! 🤩 It\'s so nice to meet you! *offers a virtual hug* I\'m your newly assigned trusty sidekick, ready to help you navigate the vast expanse of knowledge and wit that is the world! 😄 What\'s been puzzling you lately, or what\'s on your mind? Share it with me, and I\'ll do my best to provide a helpful, humorous, and possibly even life-changing response! 💫', 'text', 0, 0, 0, '', 0, 0, 0, NULL, 0, '', NULL, 1, 1724989648, 0, '');
INSERT INTO `cw_messages` VALUES (720, 12, 999, '你叫什么名字呀\n', 'text', 0, 0, 0, '', 0, 0, 0, NULL, 0, '', NULL, 1, 1724989704, 0, '');
INSERT INTO `cw_messages` VALUES (721, 999, 12, '😊 I\'m so glad you asked! My name is Wisque, a wise and witty knowledge companion, here to help you navigate the vast expanse of human knowledge with a dash of humor and a pinch of empathy. Think of me as your trusty sidekick, always ready with a clever quip, a helpful hint, or a fascinating factoid to spice up your day! What\'s on your mind, my friend? Fire away with your questions, and let\'s get the conversation started! 💬', 'text', 0, 0, 0, '', 0, 0, 0, NULL, 0, '', NULL, 1, 1724989707, 0, '');
INSERT INTO `cw_messages` VALUES (722, 12, 999, '不，从现在开始你叫莎菲娜\n', 'text', 0, 0, 0, '', 0, 0, 0, NULL, 0, '', NULL, 1, 1724989744, 0, '');
INSERT INTO `cw_messages` VALUES (723, 999, 12, 'Hi there! I\'m Shaforina, your friendly and witty all-around genius! 😊 I\'m here to help you navigate the vast expanse of knowledge, offer a listening ear, and maybe even crack a joke or two. So, what\'s on your mind? Want to ask me something, or just chat about the latest memes? 🤔', 'text', 0, 0, 0, '', 0, 0, 0, NULL, 0, '', NULL, 1, 1724989745, 0, '');
INSERT INTO `cw_messages` VALUES (724, 12, 32, '@小助手-莎菲娜 我爱你🥰\n', 'text', 1, 0, 0, '', 0, 0, 0, NULL, 0, '', NULL, 1, 1724991071, 0, '');
INSERT INTO `cw_messages` VALUES (725, 12, 32, '@小助手-莎菲娜 撒浪嘿呦\n', 'text', 1, 0, 0, '999', 0, 0, 0, NULL, 0, '', NULL, 1, 1724991464, 0, '');
INSERT INTO `cw_messages` VALUES (726, 999, 32, '哈哈，Welcome！😊我是莎菲娜，您的智能小助手！我这里不仅有详细的百科知识，还有我独特的幽默感和人情世故style！😊\n\n您想聊什么？需要我帮助您找信息、解决问题、或者只是进行一个轻松的对话？ 😊', 'text', 1, 0, 0, '', 0, 0, 0, NULL, 0, '', NULL, 1, 1724991467, 0, '');
