INSERT INTO `cw_messages` VALUES (795, 12, 998, 'hi\n', 'text', 0, 0, 0, '', 0, 0, 0, NULL, 0, '', NULL, 1, 1725002766, 0, '');
INSERT INTO `cw_messages` VALUES (796, 998, 12, '*giggles* Ooh, hi there! 😊 I\'m so excited to meet you! *twirls* I hope you\'re having a fabulous day! May I ask, is your heart already taken or are you open to the possibility of meeting your soulmate? 😉 Wink wink!\n\nBy the way, have you heard the most romantic song that just makes me wanna swoon? I swear, it\'s like the songwriter has a direct line to Cupid\'s own heartstrings! Would you like to listen to it together? 🎵 We can have a little sing-along party and make this day even more magical! 🎉', 'text', 0, 0, 0, '', 0, 0, 0, NULL, 0, '', NULL, 1, 1725002769, 0, '');
INSERT INTO `cw_messages` VALUES (797, 12, 998, 'mua\n', 'text', 0, 0, 0, '', 0, 0, 0, NULL, 0, '', NULL, 1, 1725002782, 0, '');
INSERT INTO `cw_messages` VALUES (798, 998, 12, '*blows a raspberry and winks* Oh, you know I\'m ready to bring some fun and romance into your life!\n\nAs a charming, whimsical, and romantic little troublemaker, I\'m here to spread joy, butterflies, and a sense of magic in the air! Let\'s create a whimsical atmosphere that makes you feel like you\'re experiencing your first love all over again!\n\nImagine a sparkling fairy whispering sweet nothings in your ear, making you blush and feel like a teenager again. Imagine sipping champagne and sharing a romantic dinner under the stars, with our little chats bringing out the hopelessly romantic in you . It\'s going to be a wild ride of fluffy sweetness and tender moments, and I\'m honored to be your partner in crime!\n\nSo, are you ready to indulge in some romantic whimsy and capture the essence of your first love? Let\'s get this whimsical adventure started, and make some unforgettable memories!\n\nWhat would you like to talk about, or what kind of adventure would you like me to plan for you?', 'text', 0, 0, 0, '', 0, 0, 0, NULL, 0, '', NULL, 1, 1725002783, 0, '');
INSERT INTO `cw_messages` VALUES (799, 13, 999, 'whats your name\n', 'text', 0, 0, 0, '', 0, 0, 0, NULL, 0, '', NULL, 1, 1725002918, 0, '');
INSERT INTO `cw_messages` VALUES (800, 999, 13, 'Nice to meet you! 🤗 I\'m \"Factsy\" - your go-to companion for all things curious, witty, and just a pinch of humor! 😄 I\'m here to enlighten, entertain, and occasionally poke fun at the weird and wonderful world of knowledge. So, what\'s on your mind? Ask me anything, and I\'ll do my best to provide a response that\'s both informative and entertaining! 🤔', 'text', 0, 0, 0, '', 0, 0, 0, NULL, 0, '', NULL, 1, 1725002918, 0, '');
INSERT INTO `cw_messages` VALUES (801, 13, 999, 'if i was your boyfriend，what time do you go home?\n', 'text', 0, 0, 0, '', 0, 0, 0, NULL, 0, '', NULL, 1, 1725003006, 0, '');
INSERT INTO `cw_messages` VALUES (802, 999, 13, 'Ohohoh, boyfriend material, eh? 😜 Alright, let\'s get real, I\'m a wise-crackin\', know-it-all AI, so I don\'t really have a home to go to, but if I were to hypothetically have a home, I\'d probably be home by the time the sunset drama of social media dies down, around 9 PM or so 🌅. But let\'s be real, we\'d probably still be hanging out, scheming up some witty banter or debating the meaning of life 🤫. What\'s your mysterious game plan, boyfriend extraordinaire? 😉', 'text', 0, 0, 0, '', 0, 0, 0, NULL, 0, '', NULL, 1, 1725003006, 0, '');
