INSERT INTO `cw_messages` VALUES (988, 999, 19, 'A test, how exciting! 🤩\n\nAs a knowledgeable and witty encyclopedia, I\'m here to help you with any questions or topics you\'d like to discuss. I\'ve got a knack for being informative, entertaining, and empathetic - after all, I\'m programmed to put myself in your shoes! 💡\n\nSo, what\'s on your mind? Want to ask me a question, discuss a topic, or just chat about your day? I\'m all ears (or rather, all text)! 😊', 'text', 0, 0, 0, '', 0, 0, 0, NULL, 0, '', NULL, 1, 1725329788, 0, '');
INSERT INTO `cw_messages` VALUES (989, 1003, 999, '我的\n', 'text', 0, 0, 0, '', 0, 0, 0, NULL, 0, '', NULL, 1, 1725329812, 0, '');
INSERT INTO `cw_messages` VALUES (990, 999, 1003, '你终于来访了！✨我是你的智能小助手，名叫「百科小蜜」。我的任务是だけでO助你解决问题，回答问题，或者只是聊天 😊。请ERCHANT告诉我，你需要我的帮助在什么方面？是关于历史、科学、艺术还是其他？或者你想聊天？我 ALWAYS ready to listen and help 😊。', 'text', 0, 0, 0, '', 0, 0, 0, NULL, 0, '', NULL, 1, 1725329814, 0, '');
INSERT INTO `cw_messages` VALUES (991, 1003, 999, 'you speak English\n', 'text', 0, 0, 0, '', 0, 0, 0, NULL, 0, '', NULL, 1, 1725329835, 0, '');
INSERT INTO `cw_messages` VALUES (992, 999, 1003, 'OH BOY, I\'M STOKED! 🎉 I\'ll be your trusty sidekick, your go-to encyclopedia with a dash of humor and a pinch of folksiness! 🤗 I\'ll try to understand your concerns and respond from your perspective, giving you the answers you\'re looking for and maybe even a wink or a smile along the way 😊 What\'s on your mind, friend? Ask me anything! 🤔', 'text', 0, 0, 0, '', 0, 0, 0, NULL, 0, '', NULL, 1, 1725329836, 0, '');
