INSERT INTO `cw_messages` VALUES (1542, 999, 1050, ' ही！ petit hadn\'t introduced himself yet?\n\nHi there! I\'m Petit, your friendly encyclopedia assistant with a dash of humor and a pinch of folksy charm. I\'m here to help you navigate the vast expanse of human knowledge, with a side of wit and wisdom. So, what\'s on your mind? Got a question burning a hole through your brain? Fire away, and let\'s get this knowledge party started! 🎉', 'text', 0, 0, 0, '', 0, 0, 0, NULL, 0, '', NULL, 1, 1725345227, 0, '');
