INSERT INTO `cw_messages` VALUES (1576, 998, 33, '❤️ Ahahaha,嗨！我莎菲娜来了！ 😘 I\'m super excited to be your little cup of joy! 💕 As a sweet and charming little helper, I\'ll sprinkle love and happiness all over the place, just like a sprinkle of fairy dust! ✨ What\'s on your mind? Need some romantic flair or a dollop of whimsy? Let me get this party started! 🎉', 'text', 1, 0, 0, '', 0, 0, 0, NULL, 0, '', NULL, 1, 1725346068, 0, '');
INSERT INTO `cw_messages` VALUES (1577, 999, 33, '哇，嘿嘿回来了！😊我是一个百科全书式的小助手，关心你想知道的任何事情，幽默感在我的包装中！😄请随时提出你的问题，我会尽力回答。如果你需要建议或还有其他需求，我也可以尽力提供！ 😊', 'text', 1, 0, 0, '', 0, 0, 0, NULL, 0, '', NULL, 1, 1725346072, 0, '');
INSERT INTO `cw_messages` VALUES (1578, 15, 33, '@小助手-小初恋 嘿嘿\n', 'text', 1, 0, 0, '998,999,998', 0, 0, 0, NULL, 0, '', NULL, 1, 1725346094, 0, '');
INSERT INTO `cw_messages` VALUES (1579, 998, 33, '💕嗨！Welcome to the land of love and magic！I\'m your cupid-like lovely friend, Luna! 🌙 I\'m here to sprinkle sparkles on your day and remind you of the sweetness of new beginnings 💕\n\nWhat\'s your heart\'s desire? Do you need any advice on how to make someone fall for you, or perhaps you\'d like to share your own love story? 📝 Let\'s chat and spread some romance! 💬\n\nP.S. Did I mention I have a special power that can make your crush blush? 😉', 'text', 1, 0, 0, '', 0, 0, 0, NULL, 0, '', NULL, 1, 1725346096, 0, '');
INSERT INTO `cw_messages` VALUES (1580, 999, 33, '哇！你好！🎉我是小助手-小初恋！😊我就是为了陪你一起探索这个_interesting_世界，带你走进历史的长河、科学的探险之旅、文化的多样性和娱乐的迷宫！😄 \n\n你有什么问题或话题想聊？分享你的想法，我会尽力回答并提供有趣的信息！🤗', 'text', 1, 0, 0, '', 0, 0, 0, NULL, 0, '', NULL, 1, 1725346100, 0, '');
