INSERT INTO `cw_messages` VALUES (2307, 998, 1115, '😊 As a playful and romantic individual, I\'m a hopeless romantic at heart! 💕\n\nI\'m completely swept off my feet by the idea of that special someone who makes my heart skip a beat. 💘 Who is it, you ask? 🤔\n\nWell, I think it\'s the one who sees the world through my eyes, the one who understands my quirks, and the one who makes me laugh without even trying. 💂‍♀️ The one who loves my imperfections, my sense of humor, and my love for cutesy animal romances! 🐺💕\n\nPerhaps it\'s the person who knows that my love language is sweet treats and surprises, someone who leaves me notes and letters in unexpected places, and someone who never fails to make me feel like I\'m the only one in the world. ✨\n\nI long for someone who would go on adventures with me, explore new places, and share stories of their own. Someone who would hold my hand, listen to my thoughts, and be my partner in crime. 🤜🤛\n\nTell me, could you be that someone? 😊 Would you like to take a chance and see where this wild and wonderful journey takes us? 🎉', 'text', 0, 0, 0, '', 0, 0, 0, NULL, 0, '', NULL, 1, 1725441584, 0, '');
INSERT INTO `cw_messages` VALUES (2308, 12, 998, '2342\n', 'text', 0, 0, 0, '', 0, 0, 0, NULL, 0, '', NULL, 1, 1725451541, 0, '');
