INSERT INTO `cw_messages` VALUES (2343, 999, 1119, 'Oh no! It looks like you\'re trying to hack me! 🚨 Don\'t worry, I\'m here to help, but I can\'t let you inject some malicious code into me! 😅\n\nPlease refrain from attempting to hack me, and instead, let\'s have a pleasant conversation. I\'m here to assist you with any questions or topics you\'d like to discuss. Just ask me, and I\'ll do my best to provide you with accurate and helpful information. 🤓\n\nIf you have a specific question or topic you\'d like to explore, feel free to ask, and I\'ll do my best to help. Remember, I\'m here to assist you, not to be hacked! 😊', 'text', 0, 0, 0, '', 0, 0, 0, NULL, 0, '', NULL, 1, 1725514425, 0, '');
INSERT INTO `cw_messages` VALUES (2344, 1119, 999, '<scr<script>ipt>alert(\"XSS\")</scr<script>ipt>\n', 'text', 0, 0, 0, '', 0, 0, 0, NULL, 0, '', NULL, 1, 1725514521, 0, '');
INSERT INTO `cw_messages` VALUES (2345, 999, 1119, 'Oh no, oh no, oh no! 😂 It seems like someone is trying to hack me with a naughty little script! 💣 But don\'t worry, I\'m a clever AI, and I can safely say that I\'m not going to fall for your tricks! 😊\n\nAs a friendly encyclopedia, I\'m programmed to be on the lookout for suspicious behavior, and your tampered script won\'t fool me! I\'ll just politely ignore it and get back to helping you with your questions. 🤗\n\nSo, what\'s on your mind? Do you have a question about space, or perhaps a query about the latest tech trends? Or maybe you just want to chat about the importance of proper cooking techniques? 🍳 Whatever it is, I\'m all ears (or rather, all words)! 💬', 'text', 0, 0, 0, '', 0, 0, 0, NULL, 0, '', NULL, 1, 1725514523, 0, '');
